INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_keywords_help_content',1,0,'输入的关键字将用来在相关联的网站上显示您的广告。<br /><br />为什么这个很重要：为广告组选择高质量的、相关的关键字将帮助您找到您期望的客户。<br /><br />如何工作：在内容匹配的同事，我们将使用输入的关键字来定位并展示您的广告。<br /><br />例如：在一个包含brownie recipes的网页上，有可能会同时显示关于chocolate brownie和dessert recipes的广告。',1430141479,1,1430141479,1);
INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_keywords_help_content',2,0,'Your keywords are used to show your ads on websites related to those terms.<br /><br />Why it matters: Choosing high quality, relevant keywords for your ad group can help you reach the customers you want, when you want.<br /><br />How it works: we will use your keywords to place your ads on websites, next to matching content. <br /><br />Example: On a webpage that includes brownie recipes, it might show ads about chocolate brownies or dessert recipes.',1430141524,1,1430141524,1);
INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_placements_help_title',1,0,'通过定位进一步缩小范围',1430141821,1,1430141821,1);
INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_placements_help_title',2,0,'Narrowed further by Placements',1430141868,1,1430141868,1);
INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_placements_help_content',1,0,'在特别选定的网站上显示您的广告。<br /><br />这是什么：定位是决定您的广告可以在哪些网站上展示。可以定位整个网站，部分网站（网站中的部分网页），甚至是某个页面。<br /><br />例如：如果您销售露营装备并且您希望您的广告出现在2个最流行的露营攻略网站上，您可以将那2个网站的网址添加到定位中。',1430142666,1,1430142666,1);
INSERT INTO `lt_resource_string` (`key`,`language`,`environment`,`message`,`create_time_utc`,`create_admin_id`,`update_time_utc`,`update_admin_id`) VALUES ('ad_group_placements_help_content',2,0,'Show ads on specific websites on the Network.<br /><br />What it is: Placements are locations on the Display Network where your ads can appear. A placement can be an entire website, a subset of a website (such as a selection of pages from that site), or even an individual ad unit on a single page.<br /><br />Example: If you sell camping gear and you want your ad to appear on two popular websites about camping trips, you can add those two sites to your ad group.',1430142693,1,1430142693,1);
